import React from "react";
import styles from "./Card.module.css";

const Card = () => {
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
      <img src="https://www.robohash.org/test" alt="robots" />
      <div>
        <h2>Jane Doe</h2>
        <p>janedoe@gmail.com</p>
      </div>
    </div>
  );
};

export default Card;
